ing them (5%). The number of TPs is the number of positives (5% of the pop.) x the chance of correctly classifying them (95%). Hence, p=0.5. @xamat P(Covid=Y|test=Y)= P(test=Y|covid=Y) P(covid=Y) / P(test=Y) ; 0.95 0.05 / 0.095 = 0.5 @xamat Cheeky answer categories! I'm always entertained by how similar Bayes' theorem and base rate neglect have similar names and are related to each other. @xamat 50% https://t.co/UHFkwXiQvR @xamat One of my first go-to questions while interviewing data science candidates @xamat True positives (TP): .95*5%
